package LeetCode;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Iterator;
import java.util.Map;
import java.util.Set;

public class findTheDifference {

	public static char findTheDifference(String s, String t) {

		HashMap<Character, Integer> hMap = new HashMap<Character, Integer>();
		HashMap<Character, Integer> hMap1 = new HashMap<Character, Integer>();
		int lenS = s.length();
		int lenT = t.length();

		for (int i = 0; i < lenS; i++) {
			if (hMap.get(s.charAt(i)) == null) {
				hMap.put(s.charAt(i), 1);
			} else {
				hMap.put(s.charAt(i), hMap.get(s.charAt(i)) + 1);
			}
		}

		for (int i = 0; i < lenT; i++) {
			if (hMap1.get(t.charAt(i)) == null) {
				hMap1.put(t.charAt(i), 1);
			} else {
				hMap1.put(t.charAt(i), hMap1.get(t.charAt(i)) + 1);
			}
		}

		Iterator it1 = hMap.entrySet().iterator();
		Iterator it2 = hMap1.entrySet().iterator();

		while (it2.hasNext()) {
			Map.Entry pair = (Map.Entry) it2.next();
			if (hMap.get(pair.getKey()) == null)
				return (char) pair.getKey();
			else if (hMap.get(pair.getKey()) < (int) pair.getValue()) {
				return (char) pair.getKey();
			}
		}

		return 'a';
	}

	public static void main(String[] args) {
		String s = "";
		String t = "";
		char res = findTheDifference(s, t);
		System.out.println(res);

	}
}
